const roles = 'data:image/png;base64,';
const boards = 'data:image/png;base64,';

module.exports = async function draw({text, x, y, width, height}) {
  const {Scene, Sprite, Label, Group, ENV} = require('spritejs');
  const polyfill = require('./polyfill');
  polyfill({ENV});

  const scene = new Scene({
    width,
    height,
    contextType: '2d',
  });
  const layer = scene.layer();
  
  const group = new Group();
  
  async function place(row, col, text, x = 0, y = 0) {
    if(!text) return;
    const r = Math.floor(Math.random() * 20);
    const b = Math.floor(Math.random() * 12);
    const s1 = new Sprite({
      anchor: [0, 0.5],
      pos: [x + (col-row) * 80, 30 * col + y + row * 80],
      texture: roles,
      sourceRect: [1 + r * 83, 0, 80, 120],
    });
    const s2 = new Sprite({
      anchor: [0, 0.5],
      pos: [x + (col-row) * 80, 30 * col + y - 60 + row * 80],
      texture: boards,
      sourceRect: [1 + b * 108, 0, 108, 60],
    });
    const s3 = new Label({
      text,
      fontSize: '34px',
      pos: [x + 35 + (col-row) * 80, 30 * col + y - 70 + row * 80],
      anchor: [0, 0.5],
      transform: 'skew(-0.5, 0);rotate(20deg);',
      //fillColor: 'white',
    });
    group.append(s1, s2, s3);
    await Promise.all([s1.textureImageReady, s2.textureImageReady, s3.textureImageReady])
  }
  layer.append(group);
  group.attr({
    size: [1200, 600],
    anchor: 0.5,
    pos: [0, 0],
  });
  
  async function placeAll(str, x, y) {
    let row = 0, col = 0;
    await Promise.all([...str].map((c) => {
      if(c === '\n') row++, col = 0;
      else {
        return place(row, col++, c, x, y);
      }
    }));
  }
  await placeAll(text, x, y);

  layer.render();
  return layer.canvas.toBuffer('image/png', { compressionLevel: 3, filters: layer.canvas.PNG_FILTER_NONE });
}
